import React from "react";
import Wrapper from '../assets/wrappers/Navbar';

const Navbar = () => {
  return (
    <Wrapper>
      <div className='nav-center'>
        <div className='top-header'>
          <p>
            Summer Sale For All Swim Suits And Free Express
            Delivery - OFF 50%!
          </p>
          <a></a>
        </div>
        <div></div>
      </div>
    </Wrapper>
  );
};

export default Navbar;
